void compile(const std::vector<IVTree>& trees)
{
	std::cout << "\n-----";
	
	StopWatch watch;
	std::map<uint32_t, StopWatch> watches;
	
	auto num_before = 0;
	for_each(trees.begin(), trees.end(), [&] (const IVTree& tree) {
		num_before += num_vertices(tree);
	});
	num_before *= 2;
	std::cout << format("\n[%u] num_before = %u") % __LINE__ % num_before;
    
	// Union IVTrees into a IVGraph.
	watches[0].reset();
	IVGraph iv;
	uniteTreesToDag<IVTree>(trees.begin(), trees.end(), iv);
	//print_graph(iv, get(&IVGraph::VProp::label, iv));
	watches[0].stop();
	cout << format("\n[%u] V=%u E=%u") % __LINE__ % num_vertices(iv) % num_edges(iv);
	

	// Convert IVGraph to PPEGraph.
	watches[1].reset();
	PPEGraph pg;
	convertIVGraphToPPEGraph(iv, pg);
	//print_graph(pg, get(&PPEGraph::VProp::label, pg));
	watches[1].stop();
	cout << format("\n[%u] V=%u E=%u") % __LINE__ % num_vertices(pg) % num_edges(pg);


	#if 1
	// Remove pass-through chains.
	{
	watches[2].reset();
		// Find viable root vertices.
		vector<PPEGraph::Vertex> roots;
		auto pg_vertices = vertices(pg);
		copy_if(pg_vertices.first, pg_vertices.second, back_inserter(roots), [&] (const PPEGraph::Vertex& u) {
			return (pg[u].type & 0xF00) == 0x200 && pg[u].color != -1;
		});

		// Remove pass-through chains
		removePassThroughChains(pg, roots.begin(), roots.end());
		//print_graph(pg, get(&PPEGraph::VProp::label, pg));
	watches[2].stop();
		cout << format("\n[%u] V=%u E=%u") % __LINE__ % num_vertices(pg) % num_edges(pg);
	}
	#endif

	// Remove introns.
	// This operation requires a set of viable root vertices in range-based fashion.
	// Introns are all inviable root vertices and these descendants.
	// This is a destructive (in-place) operation.
	{
	watches[3].reset();
		// Find viable root vertices.
		vector<PPEGraph::Vertex> roots;
		auto pg_vertices = vertices(pg);
		copy_if(pg_vertices.first, pg_vertices.second, back_inserter(roots), [&] (const PPEGraph::Vertex& u) {
			return (pg[u].type & 0xF00) == 0x200 && pg[u].color != -1;
		});

		// Remove introns.
		removeIntrons(pg, roots.begin(), roots.end());
		//print_graph(pg, get(&PPEGraph::VProp::label, pg));
	watches[3].stop();
		cout << format("\n[%u] V=%u E=%u") % __LINE__ % num_vertices(pg) % num_edges(pg);
	}
	
	// Coloring
	watches[4].reset();
	std::vector<PPEGraph::Vertex> vertices;
	std::map<PPEGraph::Vertex, uint32_t> reg;
	deep_subtree_first_sort(pg, back_inserter(vertices), reg);
	watches[4].stop();
	#if 1
	std::cout << "\n" << print_range(vertices.begin(), vertices.end(), ", ", [&] (std::ostream& os, PPEGraph::Vertex u) {
		os << boost::format("[%d]%s:%u") % u % pg[u].label % reg[u];
	});
	#endif
	
	watches[5].reset();
	auto l = dag::make_line_graph(pg);
	auto num_colors = dag::edge_coloring(pg, vertices.begin(), vertices.end(), l);
	
	auto num_after = num_vertices(pg);
	watches[5].stop();

	// 
	Garnet::generateScript(pg, std::cout);
	
	watch.stop();

	cout << format("\n[%u] before  |V|=%u.") % __LINE__ % num_before;
	cout << format("\n[%u] after   |V|=%u.") % __LINE__ % num_after;
	cout << format("\n[%u] viable ratio   %.3f.") % __LINE__ % ((double)num_after / num_before);

	cout << format("\n[%u] coloring") % __LINE__;
	cout << format("\n[%u]   # vertices = %u") % __LINE__ % num_vertices(l);
	cout << format("\n[%u]   # edges    = %u") % __LINE__ % num_edges(l);
	cout << format("\n[%u]   max degree = %u") % __LINE__ % getMaxDegree(l);
	cout << format("\n[%u]   # colors   = %u") % __LINE__ % num_colors;

	cout << format("\n[%u] IVTree --> IVGraph    %.3f[msec]") % __LINE__ % (watches[0].get() * 1000);
	cout << format("\n[%u] IVGraph --> PPEGraph  %.3f[msec]") % __LINE__ % (watches[1].get() * 1000);
	cout << format("\n[%u] Pass Through Removal  %.3f[msec]") % __LINE__ % (watches[2].get() * 1000);
	cout << format("\n[%u] Intron Removal        %.3f[msec]") % __LINE__ % (watches[3].get() * 1000);
	cout << format("\n[%u] Coloring              %.3f[msec]") % __LINE__ % (watches[4].get() * 1000);
	cout << format("\n[%u] time %.3f msec") % __LINE__ % (watch.get() * 1000);
}

