{
    IVTree  t[] = {
        createGraphFromSExpression<IVTree>("(Sink1(HighPass(_Src1)(Dilate3x3(_Src0))))"),
        createGraphFromSExpression<IVTree>("(Sink2(HighPass(_Src0)(Dilate3x3(_Src1))))"),
        createGraphFromSExpression<IVTree>("(Sink3(Add(Binarize(_Src2))(_Src3)))"),
    };
	
	// Show SExpressions
	for (auto i = 0u; i < 3; i++) {
		map<IVTree::Vertex, std::string> map;
		getSExpressions(t[i], map);
		for_each(map.begin(), map.end(), [] (std::map<IVTree::Vertex, std::string>::value_type& pair) {
			std::cout << pair.second << std::endl;
		});
	}

	// Accumulate num vertices of source trees.
	auto num_before = 0;
	for_each(t, t + 3, [&] (const IVTree& tree) {
		num_before += num_vertices(tree);
	});
	num_before *= 2;
    
	// Union IVTrees into a IVGraph.
	IVGraph iv;
	uniteTreesToDag<IVTree>(t, t + 3, iv);
	print_graph(iv, get(&IVGraph::VProp::label, iv));
	cout << format("\n[%u] V=%u E=%u") % __LINE__ % num_vertices(iv) % num_edges(iv);
	
	// Convert IVGraph to PPEGraph.
	PPEGraph pg;
	convertIVGraphToPPEGraph(iv, pg);
	print_graph(pg, get(&PPEGraph::VProp::label, pg));
	cout << format("\n[%u] V=%u E=%u") % __LINE__ % num_vertices(pg) % num_edges(pg);
	
	
	#if 1
	// Remove pass-through chains.
	{
		// Find viable root vertices.
		vector<PPEGraph::Vertex> roots;
		auto pg_vertices = vertices(pg);
		copy_if(pg_vertices.first, pg_vertices.second, back_inserter(roots), [&] (const PPEGraph::Vertex& u) {
			return (pg[u].type & 0xF00) == 0x200 && pg[u].color != -1;
		});

		// Remove pass-through chains
		removePassThroughChains(pg, roots.begin(), roots.end());
		print_graph(pg, get(&PPEGraph::VProp::label, pg));
		cout << format("\n[%u] V=%u E=%u") % __LINE__ % num_vertices(pg) % num_edges(pg);
	}
	#endif

	// Remove introns.
	// This operation requires a set of viable root vertices in range-based fashion.
	// Introns are all inviable root vertices and these descendants.
	// This is a destructive (in-place) operation.
	{
		// Find viable root vertices.
		vector<PPEGraph::Vertex> roots;
		auto pg_vertices = vertices(pg);
		copy_if(pg_vertices.first, pg_vertices.second, back_inserter(roots), [&] (const PPEGraph::Vertex& u) {
			return (pg[u].type & 0xF00) == 0x200 && pg[u].color != -1;
		});
		
		// Remove introns.
		removeIntrons(pg, roots.begin(), roots.end());
		print_graph(pg, get(&PPEGraph::VProp::label, pg));
		cout << format("\n[%u] V=%u E=%u") % __LINE__ % num_vertices(pg) % num_edges(pg);
	}
	
	// Coloring
	{
		std::vector<PPEGraph::Vertex> vertices;
		deep_subtree_first_sort(pg, back_inserter(vertices));
		
		auto l = dag::make_line_graph(pg);
		auto num_colors = dag::edge_coloring(pg, vertices.begin(), vertices.end(), l);
		
		cout << format("\n[%u] coloring") % __LINE__;
		cout << format("\n[%u]   # vertes   = %u") % __LINE__ % num_vertices(l);
		cout << format("\n[%u]   # edges    = %u") % __LINE__ % num_edges(l);
		cout << format("\n[%u]   max degree = %u") % __LINE__ % getMaxDegree(l);
		cout << format("\n[%u]   # colors   = %u") % __LINE__ % num_colors;
	}

	auto num_after = num_vertices(pg);
	
	cout << format("\n[%u] before  |V|=%u.") % __LINE__ % num_before;
	cout << format("\n[%u] after   |V|=%u.") % __LINE__ % num_after;
	cout << format("\n[%u] viable  %.3f.") % __LINE__ % ((double)num_after / num_before);
}

